@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:TransactionRequest a owl:Class .
atm:BankComputer a owl:Class .
atm:ATM a owl:Class .
atm:Transaction a owl:Class .
atm:Account a owl:Class .
atm:Message a owl:Class .

atm:hasTransactionRequest a owl:ObjectProperty ;
    rdfs:domain atm:Account ;
    rdfs:range atm:TransactionRequest .

atm:processesTransaction a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Transaction .

atm:sendsMessage a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Message .

atm:hasAmount a owl:DatatypeProperty ;
    rdfs:domain atm:TransactionRequest ;
    rdfs:range xsd:decimal .

atm:TransactionSucceeded a owl:NamedIndividual ;
    a atm:Message ;
    rdfs:label "transaction succeeded" .

atm:TransactionRequest a owl:Restriction ;
    owl:onProperty atm:hasTransactionRequest ;
    owl:someValuesFrom atm:Account .

atm:BankComputer a owl:Restriction ;
    owl:onProperty atm:processesTransaction ;
    owl:someValuesFrom atm:Transaction .

atm:BankComputer a owl:Restriction ;
    owl:onProperty atm:sendsMessage ;
    owl:hasValue atm:TransactionSucceeded .
